import React from "react";
import "./style.css";

function Jumbotron(props) {
  return (
    <div className="jumbotron">
      <h1>Clicky Game</h1>
      <p>Click on an image to earn points, but don't click on any more than once!</p>
    </div>
  );
}

export default Jumbotron;
